import React from 'react';
import { Link } from 'react-router-dom';
import styles from "./Project.module.css"

function Project() {

  return (
    <div id="projects" className={styles.project}>
      <div>Project</div>
      <div className={styles.projectCard}>
        <div>
        <img src={require('../img/project1.png')} alt="proejct_1" />
        </div>
        <div className={styles.projectText}>
        <Link to="ecommerce" target='_blank' rel="noopener noreferrer">电商平台</Link>
        </div>
      </div>

      <Link to="ecommerce" target='_blank' rel="noopener noreferrer">粉丝专业</Link>
      <Link to="ecommerce" target='_blank' rel="noopener noreferrer">记账网站</Link>
    </div>
  );
}

export default Project;
